import React from "react";
import { useContext } from "react";
import { Link } from "react-router-dom";
import { AuthContext } from "../context/authContext";
import Logo from "../images/noMoreWasteLogo.svg";

const navbar = () => {

  const {currentUser, logout} = useContext(AuthContext);
  return (
    <header>
      <nav class="nav collapsible">
        <p class="nav__brand">
          <Link to="/">
            <img class="logo-class" src={Logo} />
          </Link>
        </p>
        <svg class="icon icon--white nav__toggler">
          <use href="images/sprite.svg#menu"></use>
        </svg>
        <ul class="list nav__list collapsible__content">
          <span class="nav__item">{currentUser.businessname}</span>
          <li class="nav__item">
            <Link to="/profile/2?cat=profile">Profile</Link>
          </li>
          <li class="nav__item">
            <Link to="/track/2?cat=track">Track Requests</Link>
          </li>
          <li class="nav__item">
            <Link to="/support">Support</Link>
          </li>
          {currentUser ? <span onClick class="nav__item">Log Out</span> : <span></span>}
        </ul>
      </nav>
    </header>
  );
};

export default navbar;
